generatePDF=()=>{

var doc=new jsPDF()

var header=function(data){

  doc.addImage(reportImage, 'JPEG', data.settings.margin.left, 20, 50, 50);
}

doc.autoTable({html:'#table'})

doc.autoTable({

  head:[['No','start date', 'Client', 'Employee Name', 'service type','Cancelled', 'start time',' end time']],

  body:this.state.dailyreport,

  didDrawPage: function (data) {
    // Header

    doc.setTextColor(40);

    if (reportImage) {
        doc.addImage(reportImage, 'JPEG', data.settings.margin.left, 4, 15, 15);
    }
    // doc.text("Report", data.settings.margin.left + 15, 22);

    // Footer
    var str = "Page " + doc.internal.getNumberOfPages()


    // jsPDF 1.4+ uses getWidth, <1.4 uses .width
    var pageSize = doc.internal.pageSize;
    var pageHeight = pageSize.height ? pageSize.height : pageSize.getHeight();
    doc.text(str, data.settings.margin.left, pageHeight - 10);
},
margin: {top: 100,bottom:100}


  })

doc.save("output.pdf")

}



