  CheckMobileSlot=()=>{
 
    let servtime = 0;
         if (
          this.state.appdate !== "" &&
          this.state.starttime !== "" &&
          this.state.employee !== "" &&
          this.state.duration !== "" &&
          this.state.service !== ""
        ) {
          this.state.data2.map((item) => {
            if (parseInt(item.id) === parseInt(this.state.service)) {
              servtime = item.time;
            }
          });


          const durationminutes =
            parseInt(this.state.duration) + parseInt(servtime);

          const endtime = moment(this.state.starttime + ":00", "HH:mm:ss")
            .add(durationminutes, "minutes")
            .format("HH:mm");

          


          const data = {
            employee: parseInt(this.state.employee),
            date: this.state.appdate,
            start_time: this.state.starttime + ":00",
            duration: parseInt(this.state.duration),
            service: parseInt(this.state.service),
          };

          const data2 = {
            employee: parseInt(this.state.employee),
            date: this.state.appdate,
            start_time: this.state.starttime + ":00",
            duration: parseInt(this.state.duration),
            service: parseInt(this.state.service),
            lasttime: endtime + ":00",
           
          };


        



alertify.message('we are checking availability...');

          const url = "/appointment/check/";
          BaseService.PostService(url, data)
            .then((res) => {
           

              if (res.data.validity === true) {

                alertify.success("Slot Available");



                this.setState({
      
                  appointmentDet: [...this.state.appointmentDet, data2],
                  appointmentDetails: [...this.state.appointmentDetails, data],
                  starttime: "",
                  employee: "",
                  duration: "0",
                  service: "",
                  step1:false,
                  step2:false,
                  step3:false,
                  step4:false,
                  step5:true,
                  step6:false,
                  showDatePicker:false

                });
              } else {
                       this.setState({
                  starttime: "",
                  employee: "",
                  duration: "0",
                  service: "",
                  step1:true,
                  step2:false,
                  step3:false,
                  step4:false,
                  step5:false,
                  step6:false,
                  showDatePicker:true
                });

             



                alertify.alert("Slot unavailable").setHeader('').set('closable', false);
              }
            })
            .catch((err) => {
              console.log(err)
              alertify.alert(err).setHeader('').set('closable', false);
            });
        }
 
  }

